import React from "react";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import { AuthProvider, useAuth } from "@/contexts/AuthContext";
// 1. Remove Toaster import
// import { Toaster } from "@/components/ui/toaster"; 

// 2. Import New Notification System
import { NotificationProvider } from "@/contexts/NotificationContext";
import DynamicIsland from "@/components/ui/DynamicIsland";

// Pages
import Landing from "@/pages/Landing";
import Login from "@/pages/Login";
import Signup from "@/pages/Signup";
import Dashboard from "@/pages/Dashboard";
import SpaceOverview from "@/pages/SpaceOverview";
import SubmitTestimonial from "@/pages/SubmitTestimonial";
import WallOfLove from "@/pages/WallOfLove";
import ForgotPassword from "./pages/ForgotPassword";
import SuccessDemos from "./pages/SuccessDeomos"; // Note: Typo in filename 'Deomos'?

// Protected Route Component
const ProtectedRoute = ({ children }) => {
  const { user, loading } = useAuth();

  if (loading) {
    return (
      <div className="min-h-screen flex items-center justify-center">
        <div className="w-8 h-8 border-4 border-violet-600 border-t-transparent rounded-full animate-spin" />
      </div>
    );
  }

  if (!user) {
    return <Navigate to="/login" replace />;
  }

  return children;
};

function AppRoutes() {
  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/" element={<Landing />} />
      <Route path="/login" element={<Login />} />
      <Route path="/forgot-password" element={<ForgotPassword />} />
      <Route path="/signup" element={<Signup />} />
      <Route path='/success-demos' element={<SuccessDemos />} />

      {/* Public Submission Portal */}
      <Route path="/submit/:slug" element={<SubmitTestimonial />} />

      {/* Widget Embed Route */}
      <Route path="/widget" element={<WallOfLove />} />

      {/* Protected Routes */}
      <Route
        path="/dashboard"
        element={
          <ProtectedRoute>
            <Dashboard />
          </ProtectedRoute>
        }
      />
      <Route
        path="/dashboard/:spaceId"
        element={
          <ProtectedRoute>
            <SpaceOverview />
          </ProtectedRoute>
        }
      />

      {/* Catch all - redirect to home */}
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
}

function App() {
  return (
    <BrowserRouter>
      <AuthProvider>
        {/* 3. Wrap with NotificationProvider */}
        <NotificationProvider>
          {/* 4. Add the Dynamic Island at the top level */}
          <DynamicIsland />

          <AppRoutes />

          {/* 5. Removed Toaster */}
        </NotificationProvider>
      </AuthProvider>
    </BrowserRouter>
  );
}

export default App;
